var Engine, Render, World, Bodies, engine, render;
var boxA, boxB, ground;
var screen, filePicker, fileReader, images, i;

$(function() {
	screen = $("#screen")[0];
	filePicker = $("#filePick")[0];
	$("#fileShow")[0].addEventListener("click", addImages, false);
	$("#fileReset")[0].addEventListener("click", reset, false);
	$("#fileTrashcan")[0].addEventListener("click", addTrashcan, false);
	
	Composite = Matter.Composite;
	Constraint = Matter.Constraint;
	Engine = Matter.Engine;
	Render = Matter.Render;
	World = Matter.World;
	Body = Matter.Body;
	Bodies = Matter.Bodies;
	Vertices = Matter.Vertices;
	Events = Matter.Events;
	Mouse = Matter.Mouse;
	MouseConstraint = Matter.MouseConstraint;
	
	// create an engine
	engine = Engine.create();
	
	// create a renderer
	render = Render.create({
		canvas: screen,
		engine: engine,
		options: {
			wireframes: false
		}
	});
	
	// create a mouse
	mouse = Mouse.create(render.canvas);
	
	// create the things
	reset();
	
	// run the engine
	Engine.run(engine);
	
	// run the renderer
	Events.on(Render, "beforeRender", function() {
		var allBodies = Composite.allBodies(engine.world);
		
		// is it out of bounds? remove it.
		for (i = 0; i < allBodies.length; i++) { // was going to find out width and height, too difficult.
			if (allBodies[i].position.x < -1000 || allBodies[i].position.x > 1000 || allBodies[i].position.y > 1000) {
				Composite.remove(engine.world, allBodies[i]);
				console.log("body removed!");
			}
		}
		
		if ($("#fileSizeRandom")[0].checked)
			$("#fileSize")[0].value = "" + (4 + Math.floor(Math.random() * 6));
	});
	Render.run(render);
});

function reset() {
	// delete everything
	World.clear(engine.world);
	
	// create a thing that can drag around objects
	World.add(engine.world, MouseConstraint.create(engine, {
		mouse: mouse,
		constraint: {
			stiffness: 0.9,
			render: {
				visible: false
			}
		}
	}));
	
	// add a ground to the world
	World.add(engine.world, Bodies.rectangle(400, 620, 2000, 60, { isStatic: true }));
	
	// create the trashcan
	addTrashcan();
}

function addImages() {
	for (i = 0; i < filePicker.files.length; i++) {
		addImage(filePicker.files[i], i);
	}
}

function addTrashcan() {
	var image = new Image();
	image.addEventListener("load", function() {
		var small = $("#fileSize")[0].value;
		var size = correctSize(image.width, image.height, small);
		var newImage = scaleImage(image, size[0], size[1]);
		var trashcan = Vertices.create(
			[
				{x: 0, y: 0},
				{x: Math.floor(size[0] * .10), y: 0},
				{x: Math.floor(size[0] * .12), y: Math.floor(size[1] * .90)},
				{x: Math.floor(size[0] * .88), y: Math.floor(size[1] * .90)},
				{x: Math.floor(size[0] * .90), y: 0},
				{x: size[0], y: 0},
				{x: Math.floor(size[0] * .98), y: size[1]},
				{x: Math.floor(size[0] * .02), y: size[1]}
			]
		);
		// the geometry of the trashcan
		trashcan = Bodies.fromVertices(80, 200, trashcan, {
			render: {
				visible: true//false
			},
			mass: Math.floor((size[0] * size[1]) / (size[0] + size[1]))
		});
		
		// the graphics of the trashcan
		var trashcant = Bodies.rectangle(80, 200, .1, .1, {
			render: {
				sprite: {
					texture: newImage
				}
			}
		});
		
		// the thing holding them together
		var trashcould = Constraint.create({
			bodyA: trashcan,
			bodyB: trashcant,
			damping: 0,
			stiffness: 1,
			length: 0,
			render: {
				visible: false
			}
		});
		var trashbox = Composite.create();
		trashbox = Composite.add(trashbox, trashcan);
		//trashbox = Composite.add(trashbox, trashcant);
		//trashbox = Composite.add(trashbox, trashcould);
		
		World.add(engine.world, trashbox);
	});
	image.src = "data:image/png;base64,";
}

function addImage(file, i) {
	var reader = new FileReader();
	
	// after getting the data url
	reader.addEventListener("load", function () {
		var thisImage = {src: "", width: 0, height: 0};
		thisImage.src = reader.result;
		
		var image = new Image();
		// inception sound
		// after getting the image from the data
		image.addEventListener("load", function() {
			if ($("#fileShapeRect")[0].checked) imageRect(image, thisImage);
			if ($("#fileShapeCirc")[0].checked) imageCirc(image, thisImage);
		});
		image.src = thisImage.src;
	});
	reader.readAsDataURL(file);
}

function addImageFromData(data) {
	var thisImage = {src: data, width: 0, height: 0};
	
	var image = new Image();
	image.addEventListener("load", function() {
		if ($("#fileShapeRect")[0].checked) imageRect(image, thisImage);
		if ($("#fileShapeCirc")[0].checked) imageCirc(image, thisImage);
	});
	image.src = thisImage.src;
}

function imageRect(image, thisImage) {
	var size;
	var small = $("#fileSize")[0].value;
	
	if ($("#fileSizeRandom")[0].checked)
		small = 4 + Math.floor(Math.random() * 6);
	
	thisImage.width = image.width;
	thisImage.height = image.height;
	
	// scale to fit screen
	size = correctSize(thisImage.width, thisImage.height, small);
	thisImage.src = scaleImage(image, size[0], size[1]);
	
	World.add(engine.world,
		Bodies.rectangle(
			Math.random() * render.options.width,
			Math.random() * 200,
			size[0],
			size[1],
			{
				chamfer: {
					radius: Number($("#fileRound")[0].value)
				},
				render: {
					/*lineWidth: 5,*/
					sprite: {
						texture: thisImage.src
					}
				},
				mass: Math.floor((size[0] * size[1]) / (size[0] + size[1]))
			}
		)
	);
}

function imageCirc(image, thisImage) {
	var size;
	var small = $("#fileSize")[0].value;
	
	if ($("#fileSizeRandom")[0].checked)
		small = 4 + Math.floor(Math.random() * 6);
	
	thisImage.width = image.width;
	thisImage.height = image.height;
	
	size = correctSize(thisImage.width, thisImage.height, small);
	size = Math.floor((size[0] + size[1]) / 2);
	thisImage.src = scaleImage(image, size, size);
	
	World.add(engine.world,
		Bodies.circle(
			Math.random() * render.options.width,
			Math.random() * 200,
			Math.floor(size / 2),
			{
				render: {
					sprite: {
						texture: thisImage.src
					}
				},
				mass: Math.floor((size * size) / (size * 2))
			}
		)
	);
}

function correctSize(width, height, small) {
	var ratio = Math.min((render.options.width / small) / width, (render.options.height / small) / height);
	
	// scale image to screen
	return [Math.floor(width * ratio), Math.floor(height * ratio)];
}

function scaleImage(image, width, height) {
	var canvas = document.createElement("canvas");
	var ctx = canvas.getContext("2d");
	
	canvas.width = width;
	canvas.height = height;
	
	ctx.drawImage(image, 0, 0, width, height);
	
	return canvas.toDataURL();
}
